    false,nt"url": null,nt"notes": "This annual narrative report for Chincoteague
    National Wildlife Refuge outlines Refuge accomplishments during the 1972 calendar
    year. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover conditions during the year. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
    mammals, raptors, fish, reptiles, and diseases- is also covered. The Refuge development
    and maintenance section discusses physical developments, plantings, and collections
    and receipts. Resource management is outlined; topics include grazing. A progress
    report on field investigations and applied research is also provided. The public
    relations section of the report describes recreational uses, Refuge visitors, Refuge
    participation, hunting, fishing, violations, and safety. Photographs and newspaper
    articles are included.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
